    <script>
        const videoElement = document.getElementById('videoElement');
        const canvas = document.getElementById('canvas');
        const context = canvas.getContext('2d');
        const Capturebutton = document.getElementById('capture');
        const Uploadbutton = document.getElementById('upload');
        // const Uploadimg = document.getElementById('upimg').value;
        const Cookie = document.getElementById('Cookie');
        const Horns = document.getElementById('Horns');
        const Sunflower = document.getElementById('Sunflower');
        const Savebutton = document.getElementById('save');
        const constraints = {video: true, audio: false};

        Capturebutton.addEventListener('click', () =>
        {
            context.drawImage(videoElement, 0, 0, canvas.width, canvas.height);
            Savebutton.addEventListener('click', () =>
            {
                var canvasData = canvas.toDataURL('image/png');
                var ajax = new XMLHttpRequest();   
                ajax.open("POST", 'http://localhost:8080/CamagruTakeTwo/webphp/save.php', true);
                ajax.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');
                // ajax.send(canvasData);
                ajax.send("img=" + canvasData);
                // console.log(canvasData);
                window.open('../webphp/save.php','_self');
            });
        });
        var Upin = document.getElementById('upimg');
        Upin.addEventListener('change',
        function(e)
        {
            var file = this.files[0];
            var reader = new FileReader();
            reader.onload = function()
        {
        document.getElementById('up').src = this.result;
        };
        reader.readAsDataURL(file);
        var Upimg = document.getElementById('up');
        Uploadbutton.addEventListener('click', () =>
        {
            context.drawImage(Upimg, 0, 0, canvas.width, canvas.height);
            Savebutton.addEventListener('click', () =>
            {
                var canvasData = canvas.toDataURL('image/png');
                var ajax = new XMLHttpRequest();   
                ajax.open("POST", 'http://localhost:8080/CamagruTakeTwo/webphp/save.php', true);
                ajax.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');
                // ajax.send(canvasData);
                ajax.send("img=" + canvasData);
                // console.log(canvasData);
                window.open('../webphp/save.php','_self');
            });
        });
        },false); 
            // console.log(canvas);
            // console.log(file);
        Cookie.addEventListener('click', () =>
        {
            context.drawImage(Cookie, 0, 60, Cookie.width, Cookie.height);
        });
        Horns.addEventListener('click', () =>
        {
            context.drawImage(Horns, 100, 0, Horns.width, Horns.height);
        });
        Sunflower.addEventListener('click', () =>
        {
            context.drawImage(Sunflower, 240, 0, Sunflower.width, Sunflower.height);
        });
        navigator.mediaDevices.getUserMedia(constraints).then((stream) => 
        {
            videoElement.srcObject = stream;
        });
    </script>
